import React from 'react';
import {BrowserRouter,Routes,Route} from 'react-router-dom';
import Home from './Home';

const App = () => {
    return (
        <div>
            <BrowserRouter>
               <Routes>
                  <Route path='/'  exact component={Home}/>
               </Routes>
            </BrowserRouter>
        </div>
    )
}

export default App
